import React, { useState } from "react";
import axios from "axios";
import "../sass/ShowStyle/showstyle.css";
import left_result from "../img/result/left-result.png";
import right_result from "../img/result/right-result.png";
import read from "../img/box-chat/reading-img.png";

const ShowList = () => {
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");

  const fetchData = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post(
        "http://localhost:3001/api/create-list",
        {
          title,
          description,
        },
        {
          withCredentials: true,
        }
      );
      console.log(res);
      if (res === 201) {
        console.log("Succesfull");
      }
    } catch (err) {
      console.log(err);
    }
  };
  return (
    <div className="flex px-12 w-full min-h-max">
      <div className="relative flex w-full justify-end">
        <img className="absolute right-0" src={right_result} alt="" />
      </div>
      <div className="md:grid-cols-3 w-full">
        <div className="w-full">
          <form className="" action=""></form>
        </div>
      </div>
    </div>
  );
};

export default ShowList;
